import * as React from 'react'
import Typography from '@mui/material/Typography';

function DailyList() {
    return(
        <div sx={{float:"left"}}>
            <Typography align="left" variant="h5" sx={{position: 'absolute'}}>Medication</Typography>
            <Typography align="right" variant="h5" sx={{position: 'absolute'}}>Doses</Typography>

        </div>
    );
}

export default DailyList;
